corpusops_localsettings_jdk_headers:
  default: >-
    Cookie:oraclelicense=accept-securebackup-cookie
corpusops_localsettings_jdk_system_prefix: "/usr/lib/jvm/java-{{vars['corpusops_localsettings_jdk_version']}}-oracle"
